import Link from 'next/link'

function HomePage() {
  return (
  	<div>
  		<Head>
  			<title>Create Next App</title>
  			<link rel="icon" href="/favicon.ico" />
  		</Head>
  		<img src="/vercel.svg" alt="Vercel Logo" className="logo" />
  		<Link href="/about"><a>About</a></Link>
  	</div>
  );
}

export default HomePage
